      <Header />
      <S.LoginBlock>
        <S.Title>{"Welcome to I.GPT"}</S.Title>
        <S.SubTitle>{"I.GPT에서 사용자 인터뷰 서비스를 경험하세요"}</S.SubTitle>
        <Input name={"email"} placeholder={"아이디"} value={loginForm.email} />
      </S.LoginBlock>
    </S.Wrap>
  );
}

export default LoginPage;
